import React from 'react'
import {Link} from "react-router-dom"
import BlsLink from "./BlsLink"
import sidebarData from "./data/sidebarData"


function LinkGroup() {
    const linkGroup = sidebarData.map((button) => <li><Link to={{pathname:`/study/${button.series_id}`, state:{button}}}>{button.title}</Link></li>)

    return (
        <div>
            <ul>
                {linkGroup}
            </ul>
        </div>
    )
}

export default LinkGroup
